  se stane skute\u010dnou ozdobou jak\u00e9hokoli domu nebo bytu.\\nAle p\u0159\u00edprava
  st\u011bn pro dekorativn\u00ed om\u00edtky vy\u017eaduje zvl\u00e1\u0161tn\u00ed
  p\u00e9\u010di, jinak povrch nevyjde dokonale hladce.\\nAby \u0161tukov\u00e1 malta
  m\u011bla dobrou p\u0159ilnavost k povrchu st\u011bn, mus\u00ed b\u00fdt o\u010di\u0161t\u011bny
  od stavebn\u00edho prachu a ne\u010distot a pot\u00e9 zdrsn\u011bny.Na hladk\u00e9m
  povrchu roztok nebude dob\u0159e p\u0159ilnout a po zaschnut\u00ed m\u016f\u017ee
  vyschnout.P\u0159\u00edprava st\u011bn na om\u00edtku do zna\u010dn\u00e9 m\u00edry
  z\u00e1vis\u00ed na materi\u00e1lech, ze kter\u00fdch jsou vyrobeny.Pokud je om\u00edtka
  nan\u00e1\u0161ena na d\u0159ev\u011bn\u00e9 st\u011bny, je nutn\u00e9 je zakr\u00fdt
  \u0161indeli, pokud jsou z betonu, pak jsou bu\u010f vy\u0159\u00edznuty nebo pokryty
  speci\u00e1ln\u00ed om\u00edtkou.P\u0159ed om\u00edtnut\u00edm zdiva jsou \u0161vy
  zpracov\u00e1ny (vy\u0161\u00edv\u00e1ny).\\nPokud je p\u0159\u00edprava povrchu
  pro om\u00edtku provedena spr\u00e1vn\u011b, pak v dal\u0161\u00edm kroku \u0159e\u0161en\u00ed
  odstran\u00ed v\u0161echny nepravidelnosti.Zarovn\u00e1n\u00ed st\u011bn s om\u00edtkou
  je povoleno, pokud nepravidelnosti nep\u0159esahuj\u00ed 5\u20136 cm.Ale v obzvl\u00e1\u0161t\u011b
  \u201ezanedban\u00fdch\u201c p\u0159\u00edpadech to nesta\u010d\u00ed a m\u016f\u017ee
  vy\u017eadovat dal\u0161\u00ed n\u00e1t\u011br st\u011bn p\u0159ed om\u00edtkou,
  pomoc\u00ed kter\u00e9 m\u016f\u017eete\u010dern\u00fd povrch.Pro tyto \u00fa\u010dely
  pou\u017eijte prim\u00e1rn\u00ed z\u00e1kladn\u00ed n\u00e1t\u011br, jeho\u017e
  v\u00fdb\u011br z\u00e1vis\u00ed na materi\u00e1lu st\u011bn.Takov\u00e1 p\u0159\u00edprava
  st\u011bn pro om\u00edtky, pokud jsou pou\u017eity mezivrstvy, m\u016f\u017ee v\u00fdrazn\u011b
  zv\u00fd\u0161it adhezi (adhezi) roztoku k povrchu.Jsou vyb\u00edr\u00e1ny na z\u00e1klad\u011b
  materi\u00e1lu om\u00edtky.\\nP\u0159i pou\u017eit\u00ed primeru se st\u011bny vyrovn\u00e1vaj\u00ed
  pomoc\u00ed maj\u00e1k\u016f.Pro po\u010d\u00e1te\u010dn\u00ed aplikaci om\u00edtky
  se pou\u017e\u00edvaj\u00ed maj\u00e1ky vyroben\u00e9 z kovov\u00e9ho profilu.Jsou
  um\u00edst\u011bny na protilehl\u00fdch stran\u00e1ch st\u011bn a mezilehl\u00e9
  st\u011bny jsou mezi nimi fixov\u00e1ny s odstupem v z\u00e1vislosti na velikosti
  n\u00e1stroje, kter\u00fdm bude om\u00edt\u00e1n\u00ed prov\u00e1d\u011bno.Kovov\u00e9
  maj\u00e1ky jsou obvykle ponech\u00e1ny, pokud jsou st\u011bny obkl\u00e1d\u00e1ny
  keramick\u00fdmi dla\u017edicemi.Jsou vy\u0148aty ze st\u011bn pro tapety nebo malov\u00e1n\u00ed.Druhou
  metodou je pou\u017eit\u00ed maj\u00e1k\u016f vyroben\u00fdch z cementu.\\nP\u0159e\u010dt\u011bte
  si v\u00edce o materi\u00e1lu: \u0160tukovan\u00e9 zdi na maj\u00e1c\u00edch.\\nS\u00e1dra
  a j\u00edl: optim\u00e1ln\u00ed materi\u00e1ly pro om\u00edt\u00e1n\u00ed\\nNa trhu
  stavebn\u00edch materi\u00e1l\u016f existuje pom\u011brn\u011b velk\u00fd v\u00fdb\u011br
  r\u016fzn\u00fdch sm\u011bs\u00ed pro om\u00edtky, co\u017e umo\u017e\u0148uje zvolit
  nejlep\u0161\u00ed variantu na z\u00e1klad\u011b konkr\u00e9tn\u00edch provozn\u00edch
  podm\u00ednek.Nej\u010dast\u011bjipou\u017e\u00edvat cementov\u00e9 a s\u00e1drov\u00e9
  om\u00edtky.Navzdory skute\u010dnosti, \u017ee cementov\u00e9 om\u00edtky jsou levn\u011bj\u0161\u00ed,
  je v\u00fdhodn\u00e9 zarovnat st\u011bny se s\u00e1drovou om\u00edtkou.Je to v\u00edce
  plast, je s n\u00edm pohodln\u011bj\u0161\u00ed pracovat a povlak je rovnom\u011brn\u00fd
  a hladk\u00fd.S kvalitn\u00ed sm\u011bs\u00ed nem\u016f\u017ee b\u00fdt povrch tmel.Pokud
  je t\u0159eba pr\u00e1ci prov\u00e9st co nejd\u0159\u00edve, zvolte tento typ om\u00edtky,
  kterou lze pou\u017e\u00edt v jedn\u00e9 vrstv\u011b.Je v\u0161ak vhodn\u00fd pouze
  pro om\u00edt\u00e1n\u00ed vnit\u0159n\u00edch st\u011bn v m\u00edstnostech s konstantn\u00ed
  norm\u00e1ln\u00ed vlhkost\u00ed.St\u011bny s takov\u00fdm povlakem rychle schnou
  a bez um\u011bl\u00e9ho zrychlen\u00ed.Kvalitn\u00ed pr\u00e1ci lze dos\u00e1hnout
  pouze p\u0159irozen\u00fdm su\u0161en\u00edm.P\u0159i pou\u017eit\u00ed jak\u00e9hokoli
  typu om\u00edtky, zejm\u00e9na u vrchn\u00edch n\u00e1t\u011br\u016f, m\u016f\u017ee
  zrychlen\u00e9 schnut\u00ed v\u00e9st k prasklin\u00e1m, proto\u017ee vrstva bude
  nerovnom\u011brn\u011b zasychat a ne do pln\u00e9 hloubky.\\nPodrobn\u011bji v \u010dl\u00e1nku:
  S\u00e1dra.\\n\u0160tukovou sm\u011bs pro pr\u00e1ci proto nelze prov\u00e9st okam\u017eit\u011b
  ve velk\u00fdch mno\u017estv\u00edch (ne v\u00edce ne\u017e na z\u00e1klad\u011b
  5-7 minut pr\u00e1ce).\\nHlin\u011bn\u00e9 \u0161tukov\u00e9 st\u011bny jsou \u0161etrn\u00e9
  k \u017eivotn\u00edmu prost\u0159ed\u00ed a n\u00edzk\u00e9 n\u00e1klady a popt\u00e1vka
  po tomto typu povrchov\u00e9 \u00fapravy se postupn\u011b zvy\u0161uje.Je mo\u017en\u00e9
  om\u00edtnout roztok hl\u00edny jak uvnit\u0159, tak venku.Tento p\u0159\u00edrodn\u00ed
  materi\u00e1l m\u00e1 vysokou hygroskopi\u010dnost, kter\u00e1 zaji\u0161\u0165uje
  pohodlnou vlhkost v dom\u011b v z\u00e1vislosti na podm\u00ednk\u00e1ch, uvol\u0148uje
  vlhkost nebo ji absorbuje.Hl\u00edna dokonce do ur\u010dit\u00e9 m\u00edry reguluje
  teplotu v m\u00edstnosti.Ale tento typom\u00edtky nejsou tak trvanliv\u00e9 jako
  ostatn\u00ed.Pevnost j\u00edlov\u00e9 vrstvy m\u016f\u017ee b\u00fdt zv\u00fd\u0161ena
  p\u0159id\u00e1n\u00edm s\u00e1dry, v\u00e1pna nebo cementu k roztoku.Hlinitou om\u00edtku
  lze tak\u00e9 zes\u00edlit p\u0159ikryt\u00edm dal\u0161\u00ed vrstvou z jin\u00fdch
  materi\u00e1l\u016f (v\u00e1pno nebo s\u00e1dra).Pro venkovn\u00ed pr\u00e1ce je
  to povinn\u00e9.N\u011bkdy se do hlin\u011bn\u00e9ho roztoku p\u0159idaj\u00ed piliny,
  kter\u00e9 d\u00edky tomuto plnivu z\u00edskaj\u00ed siln\u011bj\u0161\u00ed strukturu,
  ne ni\u017e\u0161\u00ed ne\u017e modern\u00ed syntetick\u00e9 materi\u00e1ly.Sou\u010dasn\u011b
  se hygroskopi\u010dnost hlin\u011bn\u00e9 om\u00edtky v\u016fbec nezhor\u0161\u00ed.\\nVlastnosti
  nan\u00e1\u0161en\u00ed om\u00edtky v z\u00e1vislosti na kone\u010dn\u00e9m materi\u00e1lu\\nP\u0159\u00edprava
  st\u011bn na lakov\u00e1n\u00ed\\nOm\u00edt\u00e1n\u00ed st\u011bn na lakov\u00e1n\u00ed
  by m\u011blozvl\u00e1\u0161t\u011b opatrn\u011b, proto\u017ee po nanesen\u00ed barvy
  budou patrn\u00e9 v\u0161echny nepravidelnosti.Povrch st\u011bn je vyrovnan\u00fd,
  v\u0161echny t\u0159\u00edsky, \u0161kr\u00e1bance, praskliny a v\u00fdmoly jsou
  opraveny.Pot\u00e9 se aplikuje akrylov\u00fd primer.Pro zpevn\u011bn\u00ed povrch\u016f
  s nedostate\u010dnou hustotou se pou\u017e\u00edvaj\u00ed zpev\u0148uj\u00edc\u00ed
  a obnovuj\u00edc\u00ed p\u016fdy.V m\u00edstnostech s vysokou vlhkost\u00ed by m\u011bly
  b\u00fdt st\u011bny o\u0161et\u0159eny antimykotiky.D\u00e1le jsou povrchy tmel
  a ka\u017ed\u00e1 vrstva mus\u00ed b\u00fdt su\u0161ena po dobu nejm\u00e9n\u011b
  24 hodin a pokryta akrylov\u00fdm z\u00e1kladn\u00edm n\u00e1t\u011brem s hlubokou
  penetrac\u00ed.Pou\u017eit\u00ed netkan\u00e9 tapety nebo maskov\u00e1n\u00ed pom\u016f\u017ee
  zabr\u00e1nit prask\u00e1n\u00ed.Pro dosa\u017een\u00ed hladk\u00e9ho povrchu jsou
  v\u0161echny spoje po vysu\u0161en\u00ed d\u016fkladn\u011b tmeleny a brou\u0161eny
  jemn\u011b zrnit\u00fdm smirkov\u00fdm pap\u00edrem.P\u0159i p\u0159\u00edprav\u011b
  povrchu pro lakov\u00e1n\u00ed nelze pou\u017e\u00edt dokon\u010dovac\u00ed tmely
  vyroben\u00e9 pomoc\u00ed alabastru a z\u00e1kladny olejov\u00e9ho lepidla, proto\u017ee
  naru\u0161uj\u00ed absorpci.Chcete-li p\u0159ed zah\u00e1jen\u00edm prac\u00ed ov\u011b\u0159it
  spr\u00e1vn\u00fd v\u00fdb\u011br odst\u00ednu a textury materi\u00e1lu, mus\u00edte
  zpracovat malou \u010d\u00e1st st\u011bny.\\nP\u0159\u00edprava na dekorativn\u00ed
  om\u00edtku\\nDekorativn\u00ed om\u00edtka je pom\u011brn\u011b n\u00e1kladn\u00e1
  \u00faprava, jej\u00ed\u017e kvalita proveden\u00ed do zna\u010dn\u00e9 m\u00edry
  z\u00e1vis\u00ed na p\u0159\u00edpravn\u00e9 f\u00e1zi.P\u0159\u00edprava st\u011bn
  na dekorativn\u00ed om\u00edtky se prakticky neli\u0161\u00ed od p\u0159\u00edpravy
  na lakov\u00e1n\u00ed.M\u011bly by b\u00fdt hladk\u00e9, such\u00e9 a dostate\u010dn\u011b
  dob\u0159e absorbovat vlhkost.Primer by m\u011bl b\u00fdt vybr\u00e1n v z\u00e1vislosti
  na hloubce penetrace.Z\u00e1kladn\u00ed n\u00e1t\u011bry s nejhlub\u0161\u00ed penetrac\u00ed
  poskytuj\u00ed nejkvalitn\u011bj\u0161\u00ed a nejodoln\u011bj\u0161\u00ed povlak,
  kter\u00fd chr\u00e1n\u00ed dekorativn\u00ed povrch p\u0159ed nep\u0159\u00edzniv\u00fdmi
  \u00fa\u010dinky a deformacemi.Po \u00fapln\u00e9m zaschnut\u00ed, kter\u00e9 vy\u017eaduje
  alespo\u0148 6 hodin, m\u016f\u017ee b\u00fdt povrch st\u011bn pokryt om\u00edtkou.Relativn\u011b
  ned\u00e1vno se na trhu objevil nov\u00fd typ dekorativn\u00ed om\u00edtky, tzv.
  Hedv\u00e1b\u00ed, kter\u00e1 zcela opakovala strukturu hedv\u00e1b\u00ed.Z\u00e1kladem
  tohoto povlaku jsou bavlna nebo celul\u00f3za, polyester a barven\u00e1 hedv\u00e1bn\u00e1
  vl\u00e1kna (um\u011bl\u00e1 nebo p\u0159\u00edrodn\u00ed).Akryl se pou\u017e\u00edv\u00e1
  jako pojivo.A to i p\u0159es luxusn\u00ed vzhled, tento povlakSnadn\u00e1 aplikace
  na st\u011bny.Jedinou obt\u00ed\u017enost\u00ed je \u00faprava tlou\u0161\u0165ky
  vrstvy, kterou lze ovl\u00e1dat pouze p\u0159i sledov\u00e1n\u00ed spot\u0159eby
  materi\u00e1lu.Na druhou stranu, hedv\u00e1bn\u00e9 \u0161tukatura se neboj\u00ed
  stavebn\u00edch defekt\u016f zdi.Hedv\u00e1bn\u00fd s\u00e1drov\u00fd materi\u00e1l
  je \u0161etrn\u00fd k \u017eivotn\u00edmu prost\u0159ed\u00ed a prody\u0161n\u00fd.\\nStucco
  st\u011bny pro tapety\\nNavzdory nejr\u016fzn\u011bj\u0161\u00edm povrchov\u00fdm
  materi\u00e1l\u016fm z\u016fst\u00e1v\u00e1 tapety nejobl\u00edben\u011bj\u0161\u00edm
  typem dekorace pokoj\u016f pro r\u016fzn\u00e9 \u00fa\u010dely.Tapetov\u00e1n\u00ed
  je rychl\u00e9 a nevy\u017eaduje zvl\u00e1\u0161tn\u00ed dovednosti, ale pouze pokud
  jsou v\u0161echny p\u0159\u00edpravn\u00e9 pr\u00e1ce prov\u00e1d\u011bny na spr\u00e1vn\u00e9
  \u00farovni.Om\u00edt\u00e1n\u00ed st\u011bn pro tapety se \u010dasto prov\u00e1d\u00ed
  pomoc\u00ed s\u00e1drov\u00fdch sm\u011bs\u00ed, bez pou\u017eit\u00ed dokon\u010dovac\u00edho
  tmelu, co\u017e v\u00fdrazn\u011b sni\u017euje n\u00e1klady na pr\u00e1ci.A aby
  tapeta dob\u0159e p\u0159ilnula, jsou st\u011bny opat\u0159eny z\u00e1kladn\u00edm
  n\u00e1t\u011brem.A\u0165 u\u017e je tato \u00faspora opr\u00e1vn\u011bn\u00e1 nebo
  ne, ka\u017ed\u00fd se rozhodne s\u00e1m, ale m\u016f\u017eete dos\u00e1hnout zaru\u010den\u00e9ho
  dobr\u00e9ho v\u00fdsledku, pokud vlo\u017e\u00edte kone\u010dn\u00fd tmel po om\u00edtnut\u00ed
  st\u011bn.\\nDokon\u010dovac\u00ed om\u00edt\u00e1n\u00ed st\u011bn na rozd\u00edl
  od zdrsn\u011bn\u00ed \u010din\u00ed jejich povrch dokonale hladk\u00fdm, to v\u0161ak
  nen\u00ed ve v\u0161ech p\u0159\u00edpadech nutn\u00e9.Nap\u0159\u00edklad pro hrub\u00e9
  tapety posta\u010duje oby\u010dejn\u00e1 hrub\u00e1 om\u00edtka.\\nNau\u010den\u00ed
  se om\u00edtce\\nTi, kte\u0159\u00ed cht\u011bj\u00ed prov\u00e1d\u011bt opravy
  sami, ale nemaj\u00ed \u017e\u00e1dn\u00e9 zku\u0161enosti a zvl\u00e1\u0161tn\u00ed
  v\u00fdcvik a nev\u011bd\u00ed, jak vyrovnat zdi om\u00edtkou, mohou z\u00edskat
  p\u0159edstavu o pokrokuv\u0161echny pr\u00e1ce na videu.\\nExistuje zarovn\u00e1n\u00edst\u011bny
  se s\u00e1drov\u00fdm videem, kter\u00e9 pom\u016f\u017ee za\u010d\u00e1te\u010dn\u00edk\u016fm
  nau\u010dit se v\u0161echna tajemstv\u00ed t\u00e9to operace.Toto je kompletn\u00ed
  video instrukce, kter\u00e1 zobrazuje v\u0161echny f\u00e1ze stavebn\u00edch prac\u00ed.Z\u00edskan\u00e9
  informace poskytnou p\u0159\u00edle\u017eitost sledovat pr\u00e1ci stavitel\u016f.\"",
  "\"Prodej pozemku 960 m\u00b2\\nPraha 4, P\u00e1lavsk\u00e1\\nProdej atraktivn\u00edho
  stavebn\u00edho pozemku 960 m2, v \u017e\u00e1dan\u00e9 lokalit\u011b Praze - Kunratic\u00edch.
