  (19 x 51 m) je pln\u011b oplocen a s kompletn\u00edmi IS p\u0159\u00edmo na pozemku
  ( elekt\u0159ina, plyn, kanalizace gravita\u010dn\u00ed - sp\u00e1dov\u00e1, vodovod
  ). Pozemek v \u00daP obce spad\u00e1 pod BM \u2013 plochy bydlen\u00ed m\u011bstsk\u00e9ho
  typu, lze postavit d\u016fm do v\u00fd\u0161e sousedn\u00edch staveb. Kolem parcely
